import React from 'react';
import './training.css';
import About_img from '../../assets/About.jpg';
const Training = () => {
  return (
    <div class="container_training">
      <img src={About_img} alt="About_img" />
        <div class="text_training">А здесь будет о тренировках</div>
    </div>
  )
}

export default Training
